import React from "react";
import styled, { css } from "styled-components";

const MemberBlock = styled.div`
  width: 150px;
  height: 150px;
  border: 1px solid black;
  border-radius: 55px;
  display: inline-block;
  margin-left: 10px;
  margin-top: 10px;
  background: #faf8f8;
  text-align: center;
  ${(props) =>
    props.img &&
    css`
      background-image: url{img};
    `}
`;

function MemberList({ key, id, name, img }) {
  console.log(img);
  return (
    <MemberBlock img={img}>
      {key}
      {id}
      {name}
    </MemberBlock>
  );
}

export default MemberList;
